package com.soldesk.semi.cal;

public class Remain {

	private int c;
	private int p;
	private String r;
	private int p2;
	
	
	public Remain() {
		super();
		// TODO Auto-generated constructor stub
	}


	public Remain(int c, int p, String r, int p2) {
		super();
		this.c = c;
		this.p = p;
		this.r = r;
		this.p2 = p2;
	}


	public int getC() {
		return c;
	}


	public void setC(int c) {
		this.c = c;
	}


	public int getP() {
		return p;
	}


	public void setP(int p) {
		this.p = p;
	}


	public String getR() {
		return r;
	}


	public void setR(String r) {
		this.r = r;
	}


	public int getP2() {
		return p2;
	}


	public void setP2(int p2) {
		this.p2 = p2;
	}
	
	
	
}
